    outputNew:SetShown(false);
    
  SLASH_EXS1 = '/exsdev';
  function SlashCmdList.EXS(msg, editbox)
    if LookupBox:IsShown() == false then
      LookupBox:SetShown(true);
      outputNew:SetShown(true);
    else
      LookupBox:SetShown(false);
      outputNew:SetShown(false);
    end
  end
end

